import React from 'react';
import UsersList from "../Components/pieces/UsersList";


const Users = () => {
    const USERS = [
        {
            id: 'u1',
            name: 'Ronnie',
            image: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.wallpaperflare.com%2Fsearch%3Fwallpaper%3Dastronaut&psig=AOvVaw3hGbzBWLbI-xO5gNtUYOgR&ust=1664913135108000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCIDkr_PqxPoCFQAAAAAdAAAAABAI',
            places: '3'
        }
    ];


    return(
        <UsersList items={USERS}/>
    )
}
export default Users
